import React from 'react';
import './FilterSection.css';


function FilterSection(props) {
  all_dropdowns = [];
  Array(4).fill(0).map((_, i) => {
    all_dropdowns.push(
      <div>
        <label for="countries" className='text-gray-900'>Choose a country</label>
        <select id="countries" class="bg-gray-50 border border-gray-300 text-gray-900 text-sm rounded-lg focus:ring-violet-500 focus:border-violet-500 block w-full p-2.5">
          <option selected>Choose a country</option>
          <option value="US">United States</option>
          <option value="CA">Canada</option>
          <option value="FR">France</option>
          <option value="DE">Germany</option>
        </select>
      </div>
    )
  });

  return (
    <div className='px-12 py-5 mx-24 mt-5'>
      <div className='flex justify-between'>
        <h1 className='text-4xl font-semibold'>Search properties to rent</h1>
        <input onKeyUp={props.handleSearchChange} type="search" id="default-search" class="block p-4 h-10 text-sm text-gray-900 border border-gray-300 rounded-lg bg-gray-50 focus:ring-violet-400 focus:border-violet-500" placeholder="Search" required />
      </div>
      <div className='mt-5 grid grid-cols-4 gap-4 px-2'>
        
      </div>
    </div>
  )
}

export default FilterSection
